# Protocol: Ensuring Redis Issues Never Break Vercel Builds (Zenith SaaS)

## Introduction

This protocol provides a step-by-step guide to make sure the Zenith SaaS application can tolerate Redis being unavailable, especially during Vercel builds or runtime. By following these steps, Claude Code can prevent Redis outages or misconfigurations from crashing the app or failing deployments. Each step is explained with its purpose.

## Steps to Safeguard Redis Usage

1. **Implement Fallback Logic for Redis Unavailability:**

   * **Detect and handle connection failures:** Wrap Redis initialization in a try/catch block or use an `'error'` event listener to catch errors. For example, listen for Redis `'error'` events and set a flag (e.g., `isCacheAvailable = false`) when a connection error occurs. This prevents unhandled exceptions from crashing the app.
   * **Use in-memory or mock cache as a backup:** If Redis cannot connect (e.g., ECONNREFUSED), instantiate a substitute cache (like a simple in-memory JS object or a library like `redis-mock`). Route cache get/set calls to this in-memory store so the application continues to function. The in-memory fallback will not share data across instances, but it ensures the app **does not crash** and remains operational when Redis is down.
   * **Why this matters:** Fallback logic keeps the app responsive even if Redis is offline. Instead of throwing errors, the app uses a local cache or no-op implementation, allowing pages to load and core features to work (perhaps without real-time cache data). This gracefulness is crucial for high availability.

2. **Avoid Calling Redis During Vercel Build & Middleware:**

   * **No Redis in `getStaticProps`/`getStaticPaths`:** These run at build time, so avoid any direct Redis calls inside them. Vercel builds might not have access to a Redis server, leading to timeouts or errors. For example, a Next.js build tried to connect to `127.0.0.1:6379` and logged connection refused errors during â€œCollecting page dataâ€. To prevent such issues, fetch necessary data from an alternate source or use static defaults during the build. You can then refresh/update at runtime if needed.
   * **Caution with `getServerSideProps` and API routes:** These run at runtime (after deployment), so Redis can be used here **only if** you handle failures. Surround Redis calls with try/catch and respond with a fallback (e.g., fetch from primary DB without cache) if Redis isnâ€™t reachable. This ensures a Redis outage wonâ€™t white-screen your pages.
   * **No Redis in Edge Middleware (unless using an edge-ready store):** Next.js Middleware runs in a Vercel Edge environment, which has limitations. Traditional Redis clients (TCP connections) wonâ€™t work in Edge runtime. Calling Redis in middleware could fail or slow down requests. If rate-limiting or sessions are needed at the edge, use edge-compatible solutions (like an HTTP-based Redis service or Vercel Edge Config). Otherwise, do not use Redis in middleware â€“ perform such logic in server-side API routes instead.
   * **Why this matters:** Vercelâ€™s build environment may not have your cache available. By skipping Redis calls during build and handling them carefully at runtime, you ensure that the **deployment never fails** due to Redis. This keeps builds fast and reliable, and avoids situations where a missing Redis causes a crash in a serverless function or edge handler.

3. **Use Environment-Aware Initialization:**

   * **Attempt Redis connection only when appropriate:** Guard the Redis client setup with environment checks. For example, only connect if a `REDIS_URL` environment variable is present and you are in a production-like environment. In development or test, you might skip connecting (or use a local dummy). This can be as simple as:

     ```js
     if (process.env.REDIS_URL) {
       // connect to Redis
     } else {
       // skip or use fallback
     }
     ```

     You can also define a custom env flag (e.g., `REDIS_AVAILABLE=true` in production) and check that before connecting. This way, the code knows when itâ€™s safe to use Redis.
   * **Prevent connection during build:** If the Redis server starts up alongside your app, it might not be ready during the build phase. Use the above env checks so that `next build` (or Vercel build) doesnâ€™t even attempt a Redis connection when building static pages. For instance, set an env var like `REDIS_AVAILABLE` only at runtime, not in the build environment â€“ the code will skip Redis if that var is false or missing.
   * **Initialize lazily when possible:** Instead of connecting to Redis at the top-level of your modules (which would run immediately on import), do it inside functions or when actually needed. For example, connect inside an API route handler or when a request first requires it. This prevents unwanted connections during the initial load of modules (which can happen at build or cold start).
   * **Why this matters:** Environment-aware logic ensures the app â€œknowsâ€ when Redis is supposed to be there. It avoids false assumptions (like connecting to localhost in a cloud environment). By only initializing Redis in the right context, you eliminate errors during build and make local dev/testing easier (no need to always run Redis).

4. **Wrap Redis Connection in Try/Catch (with Example):**

   * **Surround connection logic with try/catch:** Always handle exceptions when connecting to Redis. This catches network errors or misconfigurations instead of crashing. Claude can follow this example pattern:

     ```js
     import { createClient } from 'redis';
     let redisClient;
     try {
       redisClient = createClient({ url: process.env.REDIS_URL });
       await redisClient.connect();
       console.log('âœ… Redis connected');
     } catch (err) {
       console.error('âš ï¸ Redis connection failed, using fallback:', err);
       // Fallback to a mock client or in-memory implementation
       redisClient = {
         get: async () => null,
         set: async () => {/* no-op or save to memory */}
       };
     }
     ```

     In the above, if `connect()` throws an error, it logs a warning and replaces `redisClient` with a dummy object so that any `.get` or `.set` calls wonâ€™t break the app. **This pattern can be reused** whenever Claude needs to initialize Redis.
   * **Attach error handlers:** In addition to try/catch, add an event handler for errors on the client. For example, using Node Redis or ioredis:

     ```js
     redisClient.on('error', (err) => {
       console.error('Redis error:', err);
       // You could set a flag here to indicate Redis is down
     });
     ```

     This ensures that even asynchronous errors (like a connection drop) are caught and logged. Without this, an unhandled error event could crash the Node process.
   * **Example from Next.js caching library:** One Next.js caching utility explicitly wraps Redis connection with try/catch and falls back if it fails. It attempts `await client.connect()` and on failure, logs a warning and skips using Redis. This confirms that try/catch plus fallback is a recommended approach. Claude should mirror this strategy to maintain stability.
   * **Why this matters:** Proper try/catch around Redis ops means a failed connection doesnâ€™t stop the entire app. Instead, the failure is caught and handled gracefully. This is essential for uptime â€“ e.g., if Redis is down, the app might lose caching but still serve users with fresh data. The try/catch pattern localizes any Redis problem to the cache layer, protecting the rest of the build and runtime.

5. **Abstract Redis Usage to Avoid Tight Coupling:**

   * **Define clear interfaces for cache/queue/session:** Identify where the app uses Redis â€“ common cases are caching frequently accessed data, queueing background jobs, or storing sessions. For each case, create an abstraction (interface or module) that hides the Redis implementation. For example, create a `CacheService` with methods like `get(key)` and `set(key, value)`. Internally it uses Redis, but the rest of the app calls `CacheService.get()` without knowing the details.
   * **Provide alternative implementations:** With an interface in place, you can have one implementation backed by Redis and another that is in-memory or a no-op. At startup, decide which to use based on environment (as per step 3). For instance, if `process.env.REDIS_URL` is set, use the real RedisCache; if not, use an InMemoryCache. Both implement the same methods. This way, the application code doesnâ€™t need to change â€“ it just uses the cache interface, which is fulfilled by whichever backend is available.
   * **Apply the same pattern for queues and sessions:** If using Redis for a job queue (e.g., BullMQ), consider a fallback that runs jobs immediately in-process when Redis isnâ€™t available. For sessions, if Redis is the store (e.g., for NextAuth or Express sessions), configure an alternate store in development or failover (like an encrypted cookie-based session or an in-memory store) so that user login still works temporarily. The key is to **avoid hard dependency** on Redis in your core logic.
   * **Loose coupling benefits:** By decoupling Redis from the business logic, you make future changes easier. If you swap Redis for another store or if itâ€™s down, the impact is limited to the implementation module. One team used a â€œCache Managerâ€ interface to separate Redis code from the service layer â€“ any changes in Redis or cache strategy didnâ€™t affect the main app code. In summary, an abstraction layer â€œhelps your app avoid tight coupling with the cache implementationâ€. This leads to more resilient code and simpler testing (you can plug in a mock cache for unit tests, for example).

6. **Pre-Commit Checklist for Redis Integration:** *(Before shipping any update, Claude should verify all points below to ensure Redis wonâ€™t cause build/runtime issues)*

   * **âœ”ï¸ Redis calls are wrapped in safety checks:** Every usage of the Redis client (initialization, get/set calls) should be within a try/catch or have promise `.catch` handling. No unguarded `redisClient.connect()` or `redisClient.get()` that could throw and crash the process.
   * **âœ”ï¸ Conditional usage in build/SSR:** Double-check that no code in `getStaticProps`, `getStaticPaths`, `getServerSideProps`, or Next middleware tries to connect to Redis **without a guard**. If such code exists, refactor it to only run when `process.env.REDIS_URL` is defined or skip it during static builds. For ISR (Incremental Static Regeneration) pages, ensure the regeneration function catches errors so a Redis timeout wonâ€™t break the page refresh.
   * **âœ”ï¸ Environment variables configured:** Ensure that in Vercelâ€™s dashboard, the production environment has the `REDIS_URL` (or relevant connection string) set. For safety, also set up a development or preview `REDIS_URL` if those environments use Redis. If the app expects a flag like `REDIS_AVAILABLE`, make sure to set it to â€œtrueâ€ in runtime environments and perhaps â€œfalseâ€ or leave undefined during build. This avoids accidental connections when not intended.
   * **âœ”ï¸ No hardcoded `127.0.0.1:6379` or similar:** Search the codebase for any literal Redis host/port. All connections should come from environment config so they can be turned off or changed easily. Hardcoding `127.0.0.1` can cause build-time failures (as seen with a refused connection in build logs) if Redis isnâ€™t actually running locally. Remove or replace any such hardcoding with a safe default or conditional logic.
   * **âœ”ï¸ Mocked or optional Redis in tests/CI:** Ensure the continuous integration (CI) environment doesnâ€™t require a live Redis. Claude should include a Redis mock (like using `redis-mock` or `ioredis-mock`) for running tests. For example, developers have requested the ability to use an in-memory queue for development/testing to avoid always needing Redis. Your test setup can do something similar â€“ e.g., set an env var `USE_IN_MEMORY_CACHE=true` in CI to force the app to use the in-memory implementation. This guarantees that tests and builds run reliably on any machine.
   * **âœ”ï¸ Remove unnecessary local Redis startup:** Sometimes developers start a local Redis server during build or dev (as a workaround). Verify that your build scripts or Dockerfiles do **not** attempt to start Redis just to make builds pass. Such workarounds are brittle. Itâ€™s better to rely on the appâ€™s internal fallback logic. If a startup command like `redis-server` is present (from a past fix), consider removing it now that the app can handle absence of Redis gracefully.

By following this protocol, Claude will ensure that the Zenith SaaS application remains **fully operational** even if Redis is unreachable during Vercel builds or at runtime. Each step above minimizes the risk of Redis causing a failure, thereby improving the robustness and deployability of the app. The end result is a more resilient architecture where Redis is a helpful cache/queue layer but **never a single point of failure** for the build or user-facing functionality.

**Sources:** The practices above are informed by community experiences and official guidance. For instance, catching Redis connection errors and providing an in-memory fallback is a known solution to keep apps running during outages. Vercelâ€™s documentation and examples emphasize not depending on external services during the build step. Designing an abstraction around Redis is a common best-practice to avoid tight coupling in software design. By implementing these measures, Claude can confidently integrate Redis without jeopardizing application stability.
